#include "../base/icode.hpp"
class L423 : public icode
{
private:
    const string number[10] = {
        "zero", "one", "two", "three", "four", "five", "six", "seven", "eight", "nine"};

public:
    void run()
    {
        std::cout << originalDigits("zerozero") << " 00" << endl;
        std::cout << originalDigits("") << " " << endl;
    }

    string originalDigits(string s)
    {
        int count[26] = {0}, order[10] = {0, 2, 4, 6, 8, 5, 7, 3, 9, 1}, pos[10] = {0, 0, 1, 0, 2, 0, 2, 0, 2, 1};
        for (char i : s)
        {
            ++count[i - 'a'];
        }
        string res;
        for (int i : order)
        {
            auto &item = number[i];
            int num = count[item[pos[i]] - 'a'];
            if (num == 0)
                continue;
            res.append(num, char(i + '0'));
            for (char c : item)
            {
                count[c - 'a'] -= num;
            }
        }
        std::sort(res.begin(), res.end());
        return res;
    }
};